// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.8.20;

import "./GroupcoinToken.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TreasuryContract is Ownable {
    GroupcoinToken public token;

    // Single constructor definition
    constructor(address tokenAddress) {
        token = GroupcoinToken(tokenAddress);
    }

    mapping(address => uint256) public subsidiaryBalances;

    event TokensMinted(address indexed subsidiary, uint256 amount);
    event TokensAllocated(address indexed subsidiary, uint256 amount);
    event Settlement(address indexed subsidiary, uint256 amount);

    function mintGroupcoins(address[] calldata subsidiaries, uint256[] calldata amounts) external onlyOwner {
        require(subsidiaries.length == amounts.length, "Mismatched input lengths.");
        for (uint i = 0; i < subsidiaries.length; i++) {
            token.mint(subsidiaries[i], amounts[i]);
            subsidiaryBalances[subsidiaries[i]] += amounts[i];
            emit TokensMinted(subsidiaries[i], amounts[i]);
        }
    }

    function allocateTokens(address subsidiary, uint256 amount) public onlyOwner {
        require(subsidiaryBalances[address(this)] >= amount, "Insufficient tokens in Treasury.");
        subsidiaryBalances[address(this)] -= amount;
        subsidiaryBalances[subsidiary] += amount;
        token.transfer(subsidiary, amount);
        emit TokensAllocated(subsidiary, amount);
    }

    function transferTokensBetweenSubsidiaries(address from, address to, uint256 amount) public {
        require(msg.sender == from, "Unauthorized: sender must own the tokens.");
        require(subsidiaryBalances[from] >= amount, "Insufficient balance.");
        subsidiaryBalances[from] -= amount;
        subsidiaryBalances[to] += amount;
        token.transfer(to, amount);
    }

    function settleAccounts(address[] calldata subsidiaries) external onlyOwner {
        for (uint i = 0; i < subsidiaries.length; i++) {
            uint256 balance = subsidiaryBalances[subsidiaries[i]];
            subsidiaryBalances[subsidiaries[i]] = 0;
            token.burn(subsidiaries[i], balance);
            emit Settlement(subsidiaries[i], balance);
        }
    }
}
